export default function BakeryItem({item}){
    return (
        <div>
            <h2>{item.name}</h2>
            <div><h3>${item.price}</h3>
            <h3>Calories: {item.cals}</h3></div>

            <h3>{item.type}</h3>
            <h3>{item.dietary}</h3>
            <p>{item.description}</p>
            <img
                src={item.image}
                style={{
                width: 100,
                height: 100
                }}
            />
        </div>
    )
}
